import React from 'react';

// import logo from './logo.svg';
import '../styling.css';
import './App.css';

import AboutUs from './aboutus';
import PastEvents from './pastevents';
import Upcoming from './upcoming';
import Team from './team';
import Sidebar from './sidebar';
import Dashboard from './dashboard';
import Feedback from './feedback.component';
import Footer from './footer.component';

import EditForm from './editForm';

export default class Club extends React.Component {
  state = {  }
 

  

  render() {

  

  return (
  
    
    <div className="App">
    
 
<Sidebar/>


      <header className="masthead">
<div className="container">
  <div className="intro-text">
  
    
  <div className="j2" style={{height:'100vh'}}>
    <h1 style={{paddingTop:'20%'}}>Welcome To {this.props.title} </h1></div>

    <h2>Be Part of our family</h2>
  
    <a className="btn btn-primary btn-xl text-uppercase js-scroll-trigger" href="#services">
      Tell Me More</a>
  </div>
</div>
</header> 

<EditForm/>


  <div className='j2'>         
      <AboutUs/></div>


 
      <div className='j2'>         
      <Upcoming/></div>
  
    
      <div className='j2'>         
      <PastEvents/></div>

   

      <div className='j2'>         
      <Team/></div>


      <div className='j2'><Feedback/> </div>
      <div className='j2'><Feedback/> </div>
      <div className='j2'><Footer/> </div>

      
      
  

    </div>
  );
}

}
